Сие праведно ли? Положимъ одного человѣка созданнаго какъ Адама вдругъ совершеннолѣтняго;
Не началъ ли бы онъ говорить естественно, какъ Миляонъ его говорить заставляешь. Кто я?
Гдѣ я? Откуда я пришелъ? Удивился бы онъ своему бытію; И такъ въ началѣ былъ бы онъ въ упражненіи размышленіемъ о своемъ существѣ;
А по порядку естественному кажется мнѣ, что умоночертаніе о бытіи его должно возводить его до даровавшаго ему оное;
Понимаетъ онъ, что не самъ себя создалъ, по тому, что онъ не въдаєть, а желаетъ знать, кѣмъ, какъ, и на чѣмъ онъ существуетъ.
До сего не знаетъ онъ, на-
добрѣно ль ему что дѣлать для сохраненія бытія своего;
Умоночертаніе помъ не можешь въ немъ явился, какъ уже нужды себя чувствовать заставить;
и почувствовавъ онъ бытіе свое за долго до того, какъ потребно хранить его;
